import React from 'react';
import Form from './Form';
import ImageAI from './ImageAI';


 interface ImageProps {
    imageUrl: string;
    size: string;
    name?: string;
  }
  


export default function index({imageUrl, size, name} : ImageProps) {
    return (
        <div>
            <Form/>
            <ImageAI/>
        </div>
    );
}
